from __future__ import print_function
import hashlib
import python_extension2 as extension2
import base64

def main():
    original_payload = ''
    decoded_payload = base64.b64decode(original_payload)

    # Create an instance of AndroidPayload struct
    obj = extension2.AndroidPayload()

    extension2.Deserialize(decoded_payload, obj)
    print("done")

if __name__ == '__main__':
    main()

